        id=\"instructions\">\n\t\t\t<div id=\"instructionswrapper\">\n\t\t\t\t<h3>Proxy
        list instructions and notes</h3>\n\t\t\t\t<h4>Web browser instructions</h4>\n\t\t\t\t<ul>\n\t\t\t\t\t<li><strong>Mozilla
        Firefox:</strong> Tools > Options > Advanced > Settings > Manual proxy configuration.</li>\n\t\t\t\t\t<li><strong>Google
        Chrome:</strong> Options > Under the hood > Network > Change proxy settings
        > LAN settings > Use a proxy server > Advanced > HTTP.</li>\n\t\t\t\t\t<li><strong>Internet
        Explorer:</strong> Tools > Internet options > Connections > LAN settings >
        Use a proxy server > Advanced > HTTP.</li>\n\t\t\t\t\t<li><strong>Opera:</strong>
        Tools > Preferences > Advanced > Network.</li>\n\t\t\t\t</ul>\n\t\t\t\t<h4>Anonymity
        levels</h4>\n\t\t\t\t<ul>\n\t\t\t\t\t<li><strong>Level 1:</strong> No anonymity;
        remote host knows your IP and knows you are using proxy.</li>\n\t\t\t\t\t<li><strong>Level
        4:</strong> Low anonymity; remote host does not know your IP, but it knows
        you are using proxy.</li>\n\t\t\t\t\t<li><strong>Level 8:</strong> Medium
        anonymity; remote host knows you are using proxy, and thinks it knows your
        IP, but this is not yours (this is usually a multihomed proxy which shows
        its inbound interface as REMOTE_ADDR for a target host).</li>\n\t\t\t\t\t<li><strong>Level
        16:</strong> High anonymity; remote host does not know your IP and has no
        direct proof of proxy usage (proxy-connection family header strings). If such
        hosts do not send additional header strings it may be considered as high-anonymous.
        If a high-anonymous proxy supports keep-alive you can consider it to be extremely-anonymous.
        However, such a host is highly possible to be a honey-pot.</li>\n\t\t\t\t</ul>\n\t\t\t\t<h4>Planet
        Lab / CoDeeN</h4>\n\t\t\t\t<p>PlanetLab proxy servers marked with <span id=\"plicon\">a</span>
        icon are from the Planetlab CoDeeN (CDN) Project, a network of educational
        Internet nodes at Princeton University. These proxies may force a captcha
        and allocate you a different IP address as advertised.</p>\n\t\t\t\t<h4>Security
        notes</h4>\n\t\t\t\t<p>Our proxy list database consists of third-party 'open
        proxies'; proxy servers set up for public use. We have absolutely NO control
        over any of these proxy servers and can not vouch for security, therefore
        USE OUR DATABASE AT YOUR OWN RISK. For a guaranteed secured encrypted connection,
        private servers in our control, reliable fast speeds and multiple servers
        world-wide we recommend you use our <a href=\"/vpn/\">VPN service</a>.</p>\n\t\t\t</div>\n\t\t\t<!--
