        Tools > Preferences > Advanced > Network.</li>\n\t\t\t\t</ul>\n\t\t\t\t<h4>Anonymity
        levels</h4>\n\t\t\t\t<ul>\n\t\t\t\t\t<li><strong>Level 1:</strong> No anonymity;
        remote host knows your IP and knows you are using proxy.</li>\n\t\t\t\t\t<li><strong>Level
        4:</strong> Low anonymity; remote host does not know your IP, but it knows
        you are using proxy.</li>\n\t\t\t\t\t<li><strong>Level 8:</strong> Medium
        anonymity; remote host knows you are using proxy, and thinks it knows your
        IP, but this is not yours (this is usually a multihomed proxy which shows
        its inbound interface as REMOTE_ADDR for a target host).</li>\n\t\t\t\t\t<li><strong>Level
        16:</strong> High anonymity; remote host does not know your IP and has no
        direct proof of proxy usage (proxy-connection family header strings). If such
        hosts do not send additional header strings it may be considered as high-anonymous.
        If a high-anonymous proxy supports keep-alive you can consider it to be extremely-anonymous.
        However, such a host is highly possible to be a honey-pot.</li>\n\t\t\t\t</ul>\n\t\t\t\t<h4>Planet
